import { useNavigate } from "react-router-dom"

export default function Home()
{
    const navigate=useNavigate();

    function handleCabAgencySignup()
    {
        navigate(`/signup/${"cabagency"}`)
    }

    function handleCustomerSignup()
    {
        navigate(`/signup/${"customer"}`)
    }

    function handleCabAgencyLogin()
    {
        navigate(`/login/${"cabagency"}`)
    }

    function handleCustomerLogin()
    {
        navigate(`login/${"customer"}`)
    }

    return(


            <Navbar bg="light" expand="lg">
                <Navbar.Brand href="#home">Cab Booking Application</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <NavDropdown title="Signup" id="signup-dropdown">
                            <NavDropdown.Item onClick={handleCabAgencySignup}>Signup as Cab Agency</NavDropdown.Item>
                            <NavDropdown.Item onClick={handleCustomerSignup}>Signup as Customer</NavDropdown.Item>
                        </NavDropdown>
                        <NavDropdown title="Login" id="login-dropdown">
                            <NavDropdown.Item onClick={handleCabAgencyLogin}>Login as Cab Agency</NavDropdown.Item>
                            <NavDropdown.Item onClick={handleCustomerLogin}>Login as Customer</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>

    )
}
